import React from 'react';
import './styles/main.scss';
import {Switch, Route} from 'react-router-dom'
import Home from './homepage/Home';
import data from '../games.json'


function App() {
  return (
    <div>
      <Switch>
        <Route exact path="/" render={props =>(
          <Home
            {...props}
            games={data.games}          
          />
        )}></Route>
      </Switch>
    </div>
  );
}

export default App;
